module SCAN_IN_CELL (Si , scan_clock, update_clock, se, So, Din_DUT ); 
 input Si, scan_clock, update_clock, se ;
 output So, Din_DUT ;
 wire w1 ;

 SDFQD4BWP SCELL1 (.SI(Si), .D(w1) , .Q(w1) , .SE(se) , .CP(scan_clock)) ; 
 DEL075D1BWP DELCELL1 (.I(w1), .Z(So)) ; 
 DFQD4BWP SCELL2 (.D(So), .Q(Din_DUT), .CP(update_clock)) ;
endmodule 


module SCAN_OUT_CELL (Dout_DUT , Si, scan_clock, se, So ); 
