 output So ;
 wire w1 ;

 SDFQD4BWP SCELL1 (.SI(Si), .D(Dout_DUT) , .Q(w1) , .SE(se) , .CP(scan_clock)) ; 
 DEL075D1BWP DELCELL1 (.I(w1), .Z(So)) ; 
endmodule 


